import React from 'react';
import { useNavigate } from 'react-router-dom';

const LoginPage = () => {
    const navigate = useNavigate();
const HomePage = () => {
  return (
    <div style={{ backgroundColor: 'lightgreen', minHeight: '100vh' }}>
      <center>
        <h1>E-farming</h1>
        <h3>
          <a href="info.html">Information</a>&nbsp;&nbsp;&nbsp;
          <a href="about.html">About us</a>&nbsp;&nbsp;&nbsp;
          <a href="contact.html">Contact us</a>
        </h3>
        <br />
        <img src="Homepage.jpg" alt="Homepage" height="400px" width="400px" />
        <br /><br />
        <button
          style={{
            height: '40px',
            width: '100px',
            borderRadius: '50px',
            marginTop: '20px',
          }}
        >
          <a href="loginpage.html" style={{ textDecoration: 'none', color: 'black' }}>Login</a>
        </button>
        <br /><br />
        <img src="hompage2.jpg" alt="Homepage 2" height="400px" width="400px" />
      </center>
    </div>
  );
};
};
export default HomePage;
